const [events, setEvents] = useState([]);
useEffect(() => {
  axios.get(`http://localhost:8000/api/grievances/${grievanceId}/events/`, {
    headers: { Authorization: `Token ${authToken}` }
  }).then(res => setEvents(res.data));
}, [grievanceId, authToken]);
